const msgList = (state = initalState, action) => {
    switch (action.type) {
        case 'GET_LIST':
            return {
                ...state,
            }
        case 'SET_SELECTED_ITEM':
            return {
                ...state,
                selectedItem: action.selectedItem,
            }
        default:
            return state
    }
}

export default msgList